column4:
دوباره یه روز خوب ، یه رویای قشنگ واسه آینده

باهم شهر رویاهایمان را می سازیم

به لطف خدا و یاری شما عزیزان و خیرین گرامی
به عشق مولا علی (ع) بیش از ۵۰۰ اصله نهال مثمر از قبیل توت ، سنجد ، انجیر ، انار ، شاتوت در تفرجگاه حصارامیر در تاریخ ۳۰ اردیبهشت ۱۴۰۱ به مناسبت روز ملی جمعیت و بزرگداشت سوم خرداد کاشته شد

تشکر از جناب آقای قره داغی مدیر عامل محترم شرکت شودر ، نهالستان ماشاالله یزدی و تمام خیرین پویش نذر درختکاری

ماشاءالله به وجودتون

